import { Injectable } from '@angular/core';
import { ImagePickerOptions, ImagePicker } from '@ionic-native/image-picker';
/**
 * Image Picker mockup
 * 
 * @author NorrapatN
 * @since Wed Jun 21 2017
 */
@Injectable()
export class ImagePickerMockup extends ImagePicker {

  public getPictures(options: ImagePickerOptions): Promise<any> {
    return new Promise((resolve, reject) => {
      // let filePath = prompt('File path start with file://', '');
      let filePath = `data:image/png;base64,`;
      resolve([filePath]);
    });
  }
}
